def transform(sequence):
    zeros_count = 0
    for i in range(len(sequence)):
        if sequence[i] == '0':
            zeros_count += 1
        elif sequence[i] != '0':
            break

    n = len(sequence)
    transformed_sequence = '0'*zeros_count + sequence[n-2] + sequence[n-1] + '0'*(n-2-zeros_count)

    return transformed_sequence
